import React, { Component } from "react";

class Title extends Component {
  constructor() {
    super();
    
    this.objeto = [
      {
        id: 1,
        nombre: "Carlos",
      },

      {
        id: 2,
        nombre: "Ariel",
      },

      {
        id: 3,
        nombre: "Kendall",
      },
    ];
  }
  render() {
    return (
      <div className='Center'>
        {this.objeto.map((el) => (
          <p>{el.nombre}</p>
        ))}

      {this.objeto.map((el))}

      </div>
    );
  }
}

export default Title;
